import Vue from 'vue'
import VueRouter from 'vue-router'

//安装vueRouter插件，对vue功能的扩展
Vue.use(VueRouter)

export default new VueRouter({
	routes:[
		{
			path:"/",
			redirect:'/getalldept'//重定向
		},
		{
			name:"getalldept",
			path:"/getalldept",
			component: ()=> import("../views/getalldept.vue")
		},
		{
			name:"updatedept",
			path:"/updatedept",
			component: ()=> import("../views/updatedept.vue")
		},
		{
			name:"insertdept",
			path:"/insertdept",
			component: ()=> import("../views/insertdept.vue")
		},
		{
			name:"searchemp",
			path:"/searchemp",
			component: ()=> import("../views/searchemp.vue")
		},
		{
			name:"getallgoods",
			path:"/getallgoods",
			component: ()=> import("../views/getallgoods.vue")
		}
	]
});
